





delete from series;





update books set created_at = (SELECT NOW() - INTERVAL FLOOR(RAND() * 600) DAY);




UPDATE basket_items SET items_count = 1 + FLOOR(RAND()*10);

UPDATE baskets b SET total_amount = (SELECT coalesce(sum(c.price), 0) FROM catalogue c 
	join basket_items bi on c.book_id = bi.book_id where bi.basket_id = b.id);
    



update orders set created_at = (SELECT NOW() - INTERVAL FLOOR(RAND() * 365) DAY);
update orders set closed_at = (created_at + INTERVAL FLOOR(RAND() * 5) DAY);
update orders set closed_at = null where status_id <> 6;



UPDATE order_items SET item_count = 1 + FLOOR(RAND()*5), price = RAND()*500;

UPDATE orders o SET o.items_amount = (select coalesce(sum(oi.price * oi.item_count), 0) from order_items oi where oi.order_id = o.id);
UPDATE orders SET pay_amount = items_amount + delivery_amount;














